window.bookSummaryJSON = "<p>The elves have a plan to save humanity...by enslaving them. And the angels are too busy to intervene. </p> <p>Aaru is at war. The rebel angels are calling for Sam's exclusion from the Ruling Council and her banishment to Hel. But Sam's isn't the only future at risk. If they're defeated, Gregory and his brothers will face exile, losing everything they've spent billions of years to build. </p> <p>The fate of heaven and earth is in the balance, and only an angel from Hel can save them both. </p>"; 
